import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Rating = ({ role, userId }) => {
  const [form, setForm] = useState({
    lecture_id: '',
    target_id: '', // lecturer_id if student, student_id if lecturer
    rating: '',
    comment: ''
  });
  const [message, setMessage] = useState('');
  const [ratings, setRatings] = useState([]);
  const [loading, setLoading] = useState(true);

  // Fetch existing ratings based on role and userId
  useEffect(() => {
    const fetchRatings = async () => {
      try {
        const token = localStorage.getItem('token');
        if (!token) {
          setMessage('Please log in to view ratings.');
          setLoading(false);
          return;
        }

        let url = `${process.env.REACT_APP_API_URL}/rating`;
        if (role === 'student') {
          url += `/lecturer/${userId}`; // Fetch ratings where lecturer_id matches userId
        } else if (role === 'lecturer') {
          url += `/student/${userId}`; // Fetch ratings where student_id matches userId
        }

        const res = await axios.get(url, { headers: { 'x-auth-token': token } });
        setRatings(res.data);
      } catch (err) {
        setMessage('Error fetching ratings: ' + (err.response?.data?.message || err.message));
        console.error('Fetch ratings error:', err);
      } finally {
        setLoading(false);
      }
    };

    fetchRatings();
  }, [role, userId]);

  const handleChange = (e) => setForm({ ...form, [e.target.name]: e.target.value });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        setMessage('Please log in to submit a rating.');
        return;
      }

      const res = await axios.post(
        `${process.env.REACT_APP_API_URL}/rating`,
        form,
        { headers: { 'x-auth-token': token } }
      );
      setMessage(res.data.message);
      setForm({ lecture_id: '', target_id: '', rating: '', comment: '' });
      // Refresh ratings after submission
      const fetchRes = await axios.get(`${process.env.REACT_APP_API_URL}/rating`, { headers: { 'x-auth-token': token } });
      setRatings(fetchRes.data);
    } catch (err) {
      setMessage(err.response?.data?.message || 'Error submitting rating');
      console.error('Rating submit error:', err);
    }
  };

  return (
    <div>
      <h2>{role === 'student' ? 'Rate Lecturer' : 'Rate Student'}</h2>
      {message && <p>{message}</p>}
      {loading ? (
        <p>Loading ratings...</p>
      ) : (
        <>
          <h3>Existing Ratings</h3>
          {ratings.length > 0 ? (
            <ul>
              {ratings.map((rating) => (
                <li key={rating.id}>
                  {role === 'student' ? 'Lecturer' : 'Student'} ID: {rating.lecturer_id || rating.student_id}, 
                  Rating: {rating.rating}, 
                  Comment: {rating.comment || 'None'}, 
                  Created: {new Date(rating.created_at).toLocaleDateString()}
                </li>
              ))}
            </ul>
          ) : (
            <p>No ratings available.</p>
          )}
        </>
      )}
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="lecture_id"
          placeholder="Lecture ID"
          value={form.lecture_id}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="target_id"
          placeholder={role === 'student' ? 'Lecturer ID' : 'Student ID'}
          value={form.target_id}
          onChange={handleChange}
          required
        />
        <input
          type="number"
          name="rating"
          placeholder="Rating (1-5)"
          min="1"
          max="5"
          value={form.rating}
          onChange={handleChange}
          required
        />
        <textarea
          name="comment"
          placeholder="Comment (optional)"
          value={form.comment}
          onChange={handleChange}
        />
        <button type="submit">Submit Rating</button>
      </form>
    </div>
  );
};

export default Rating;
